import React, { useState } from "react";
import styled from "styled-components";
import bgImage from "../assets/signup-bg.png";

export default function Signin() {
  const [nickname, setNickname] = useState("");
  const [birth, setBirth] = useState("");
  const [userId, setUserId] = useState("");
  const [pw, setPw] = useState("");
  const [pw2, setPw2] = useState("");

  const [idValid, setIdValid] = useState(null);
  const [idMsg, setIdMsg] = useState("");
  const [pwMatch, setPwMatch] = useState(null);
  const [pwMsg, setPwMsg] = useState("");

  const onClickCheckId = () => {
    if (!userId) {
      setIdValid(false);
      setIdMsg("아이디를 입력해주세요.");
      return;
    }
    // 예시 로직: 'test'로 시작하면 중복
    if (userId.toLowerCase().startsWith("test")) {
      setIdValid(false);
      setIdMsg("이미 사용 중인 아이디입니다.");
    } else {
      setIdValid(true);
      setIdMsg("사용 가능한 아이디입니다.");
    }
  };

  const onChangePw = (v) => {
    setPw(v);
    if (!pw2) { setPwMatch(null); setPwMsg(""); return; }
    const same = v === pw2;
    setPwMatch(same);
    setPwMsg(same ? "비밀번호가 일치합니다." : "비밀번호가 일치하지 않습니다.");
  };

  const onChangePw2 = (v) => {
    setPw2(v);
    if (!pw) { setPwMatch(null); setPwMsg(""); return; }
    const same = pw === v;
    setPwMatch(same);
    setPwMsg(same ? "비밀번호가 일치합니다." : "비밀번호가 일치하지 않습니다.");
  };

  return (
    <Container>
      <Title>회원가입</Title>

      <Form>
        <InputBox
          placeholder="닉네임"
          value={nickname}
          onChange={(e) => setNickname(e.target.value)}
        />

        <div>
          <InputBox
            placeholder="출생연도"
            inputMode="numeric"
            maxLength={4}
            value={birth}
            onChange={(e) => setBirth(e.target.value)}
          />
          <Helper>예) 2004</Helper>
        </div>

        <div>
          <IdRow>
            <IdInput
              placeholder="아이디"
              value={userId}
              onChange={(e) => {
                setUserId(e.target.value);
                setIdValid(null);
                setIdMsg("");
              }}
            />
            <CheckButton onClick={onClickCheckId}>
              중복<br/>확인
            </CheckButton>
          </IdRow>
          <ValidationMessage isvalid={idValid}>
            {idMsg || "예) 2004"}
          </ValidationMessage>
        </div>

        <InputBox
          type="password"
          placeholder="비밀번호"
          value={pw}
          onChange={(e) => onChangePw(e.target.value)}
        />

        <div>
          <InputBox
            type="password"
            placeholder="비밀번호 확인"
            value={pw2}
            onChange={(e) => onChangePw2(e.target.value)}
          />
          <ValidationMessage isvalid={pwMatch}>
            {pwMsg || "예) 2004"}
          </ValidationMessage>
        </div>
      </Form>
    </Container>
  );
}

/* ===== styled-components ===== */

const Container = styled.div`
  width: 393px;
  height: 852px;
  background: url(${bgImage}) no-repeat center center;
  background-size: contain;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 2.5rem 1.25rem;
  margin: 0 auto;
`;

const Title = styled.h1`
  font-size: 3rem;
  color: #4CAF50;
  margin-top: 3.75rem;
`;

const Form = styled.div`
  width: 17.25rem;
  margin-top: 1.875rem;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 1.875rem;
`;

const InputBox = styled.input`
  width: 17.25rem;
  height: 3rem;
  box-sizing: border-box;
  border: 0.125rem solid #8F8F8F;
  border-radius: 0.625rem;
  font-size: 1rem;
  padding-left: 1rem;
  outline: none;
`;

const Helper = styled.p`
  margin: 0;
  margin-top: 0.625rem;
  font-size: 1rem;
  color: #666;
  text-align: left;
  width: 100%;
`;

const IdRow = styled.div`
  display: flex;
  align-items: center;
  gap: 0.3125rem;
  width: 100%;
`;

const IdInput = styled(InputBox)`
  width: 221px;
  flex: none;
`;

const CheckButton = styled.button`
  width: 50px;
  height: 3rem;
  background-color: #32885D;
  color: #fff;
  font-size: 0.8125rem;
  border: none;
  border-radius: 0.625rem;
  padding: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  line-height: 1.1;
  text-align: center;
  cursor: pointer;
`;

const ValidationMessage = styled.p`
  margin: 0;
  margin-top: 0.625rem;
  font-size: 0.9375rem;
  width: 100%;
  text-align: left;
  color: ${({ isvalid }) =>
    isvalid === true ? "#16a34a" : isvalid === false ? "#ef4444" : "#666"};
`;
